import React from "react";
import { Card } from "antd";
import ageChecker from "../../Assets/Images/agechecker.jpg";
import fbLogin from "../../Assets/Images/facebook login clone.jpg";
import productCard from "../../Assets/Images/product card.jpg";

const Cards = () => {
  const cardData = [
    {
      title: "App Login Page",
      content: (
        <a href="https://age-calculator-livid.vercel.app/" target="_blank">
          <img src={ageChecker} className="w-full h-full" />
        </a>
      ),
    },
    {
      title: "Online Store Products Card",
      content: (
        <a href="https://age-calculator-livid.vercel.app/" target="_blank">
          <img src={productCard} className="w-full h-full" />
        </a>
      ),
    },
    {
      title: "Age Checker Calculator",
      content: (
        <a href="https://age-calculator-livid.vercel.app/" target="_blank">
          <img src={ageChecker} className="w-full h-full" />
        </a>
      ),
    },
    {
      title: "Facebook Login Page Clone",
      content: (
        <a href="https://age-calculator-livid.vercel.app/" target="_blank">
          <img src={fbLogin} className="w-full h-full" />
        </a>
      ),
    },
    {
      title: "Basic Calculator",
      content: (
        <a href="https://age-calculator-livid.vercel.app/" target="_blank">
          <img src={ageChecker} className="w-full h-full" />
        </a>
      ),
    },
    {
      title: "Age Calculator",
      content: (
        <a href="https://age-calculator-livid.vercel.app/" target="_blank">
          <img src={ageChecker} className="w-full h-full" />
        </a>
      ),
    },
  ];

  return (
    <div className="flex items-center flex-wrap justify-around gap-[5rem]">
      {cardData.map((item, index) => (
        <Card
          key={index}
          cover={item.content}
          className="w-[300px] h-[290px] mb-[50px] shadow-md text-center"
        >
          <div>
            <h2>{item.title}</h2>
          </div>
        </Card>
      ))}
    </div>
  );
};

export default Cards;
